import { createAsyncThunk } from "@reduxjs/toolkit";

export const register = createAsyncThunk('auth/register', (res) => {
    const { name, email, password } = res
    
    const config = {
        headers: {
            'Content-Type': 'application/json'
        }
    }

    const body = JSON.stringify({ res })
})
